Алдымен белгішені түртіңіз. Одан кейін:

• мәтін не кескін сияқты белгілі бір элементті түртіңіз;
• саусағыңызды экран бетімен сырғытып, бірнеше элементті таңдаңыз;
• барлығы оқылып шығуы үшін, \"Ойнату\" түймесін басыңыз."
